  `aggregate` varchar(20) DEFAULT NULL COMMENT '聚合类型',
  `subconditionid` varchar(40) DEFAULT NULL COMMENT '聚合条件表达式',
  `columnwidth` int(11) DEFAULT NULL COMMENT '列宽度',
  `autosizetimes` int(11) DEFAULT NULL COMMENT '自动调整列宽次数',
  `flex` int(11) DEFAULT NULL COMMENT 'flex值',
  `hidden` tinyint(4) DEFAULT '0' COMMENT '隐藏列',
  `locked` tinyint(4) DEFAULT '0' COMMENT '锁定列',
  `othersetting` varchar(200) DEFAULT NULL COMMENT '附加设置',
  `remark` varchar(200) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`columnid`),
  KEY `fk_fov_grid_reference_f_datao4` (`subconditionid`),
  KEY `fk_fov_grid_reference_f_datao3` (`fieldid`),
  KEY `fk_fov_grid_reference_fov_gri2` (`gridschemeid`),
  KEY `fk_fov_grid_reference_fov_gri3` (`parentid`),
  CONSTRAINT `fk_fov_grid_reference_f_datao3` FOREIGN KEY (`fieldid`) REFERENCES `f_dataobjectfield` (`fieldid`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_fov_grid_reference_f_datao4` FOREIGN KEY (`subconditionid`) REFERENCES `f_dataobjectcondition` (`conditionid`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_fov_grid_reference_fov_gri2` FOREIGN KEY (`gridschemeid`) REFERENCES `fov_gridscheme` (`gridschemeid`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_fov_grid_reference_fov_gri3` FOREIGN KEY (`parentid`) REFERENCES `fov_gridschemecolumn` (`columnid`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='列表(Grid)方案列表[FOV_GridSchemeColumn]';
